import React, { useState } from 'react';
import { Alert, AlertDescription } from '@/components/ui/alert';

interface FormData {
  organizationName: string;
  navigatorName: string;
  intakeDate: string;
  firstName: string;
  middleName: string;
  lastName: string;
  dateOfBirth: string;
  gender: string;
  countryOfOrigin: string;
  preferredLanguage: string;
  phoneNumber: string;
  email: string;
  streetAddress: string;
  city: string;
  zipCode: string;
  state: string;
  county: string;
  mailingAddress: string;
  dshsClientId: string;
  alienNumber: string;
  immigrationStatus: {
    type: string;
    eligibilityDate: string;
  };
}

const CommunityIntakeForm: React.FC = () => {
  const [formData, setFormData] = useState<FormData>({
    organizationName: '',
    navigatorName: '',
    intakeDate: '',
    firstName: '',
    middleName: '',
    lastName: '',
    dateOfBirth: '',
    gender: '',
    countryOfOrigin: '',
    preferredLanguage: '',
    phoneNumber: '',
    email: '',
    streetAddress: '',
    city: '',
    zipCode: '',
    state: '',
    county: '',
    mailingAddress: '',
    dshsClientId: '',
    alienNumber: '',
    immigrationStatus: {
      type: '',
      eligibilityDate: '',
    },
  });

  const [errors, setErrors] = useState<Partial<FormData>>({});

  const immigrationStatusOptions = [
    {
      id: 'refugee',
      label: 'Refugee',
      description: 'Eligibility starts the date of entry into the United States; eligible for up to five years.',
    },
    {
      id: 'asylum',
      label: 'Asylum',
      description: 'Approved and granted asylum by USCIS or DOJ. Eligibility starts from their date of approval; eligible for up to five years.',
    },
    // Add other immigration status options
  ];

  const handleChange = (e: React.ChangeEvent<HTMLInputElement | HTMLSelectElement>) => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: value,
    }));
  };

  const validateForm = (): boolean => {
    const newErrors: Partial<FormData> = {};

    if (!formData.organizationName) newErrors.organizationName = 'Required';
    if (!formData.firstName) newErrors.firstName = 'Required';
    if (!formData.lastName) newErrors.lastName = 'Required';

    // Email validation
    const emailRegex = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;
    if (formData.email && !emailRegex.test(formData.email)) {
      newErrors.email = 'Invalid email format';
    }

    // Phone validation
    const phoneRegex = /^\(\d{3}\) \d{3}-\d{4}$/;
    if (formData.phoneNumber && !phoneRegex.test(formData.phoneNumber)) {
      newErrors.phoneNumber = 'Invalid phone format';
    }

    setErrors(newErrors);
    return Object.keys(newErrors).length === 0;
  };

  const handleSubmit = (e: React.FormEvent) => {
    e.preventDefault();
    if (validateForm()) {
      // Submit form data
      console.log('Form submitted:', formData);
    }
  };

  return (
    <form onSubmit={handleSubmit} className="max-w-4xl mx-auto p-6 space-y-8">
      <div className="bg-white shadow-md rounded-lg p-6">
        <h1 className="text-2xl font-bold mb-6">Community Outreach and Education Intake/Registration Form</h1>

        {/* Organization Information */}
        <div className="space-y-4 mb-8">
          <div>
            <label htmlFor="organizationName" className="block text-sm font-medium text-gray-700">
              Organization Name *
            </label>
            <input
              type="text"
              id="organizationName"
              name="organizationName"
              value={formData.organizationName}
              onChange={handleChange}
              className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-blue-500 focus:ring-blue-500"
            />
            {errors.organizationName && (
              <Alert variant="destructive">
                <AlertDescription>{errors.organizationName}</AlertDescription>
              </Alert>
            )}
          </div>

          <div>
            <label htmlFor="navigatorName" className="block text-sm font-medium text-gray-700">
              Navigator Name *
            </label>
            <input
              type="text"
              id="navigatorName"
              name="navigatorName"
              value={formData.navigatorName}
              onChange={handleChange}
              className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-blue-500 focus:ring-blue-500"
            />
          </div>

          <div>
            <label htmlFor="intakeDate" className="block text-sm font-medium text-gray-700">
              Intake Date *
            </label>
            <input
              type="date"
              id="intakeDate"
              name="intakeDate"
              value={formData.intakeDate}
              onChange={handleChange}
              className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-blue-500 focus:ring-blue-500"
            />
          </div>
        </div>

        {/* Participant Information */}
        <h2 className="text-xl font-semibold mb-4">Participant Information</h2>
        <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
          <div>
            <label htmlFor="firstName" className="block text-sm font-medium text-gray-700">
              First Name *
            </label>
            <input
              type="text"
              id="firstName"
              name="firstName"
              value={formData.firstName}
              onChange={handleChange}
              className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-blue-500 focus:ring-blue-500"
            />
          </div>

          {/* Add other personal information fields */}
        </div>

        {/* Immigration Status */}
        <h2 className="text-xl font-semibold my-4">Current Immigration Status</h2>
        <div className="space-y-4">
          {immigrationStatusOptions.map((option) => (
            <div key={option.id} className="flex items-start">
              <input
                type="radio"
                id={option.id}
                name="immigrationStatus.type"
                value={option.id}
                onChange={handleChange}
                className="mt-1"
              />
              <label htmlFor={option.id} className="ml-2 block text-sm text-gray-700">
                <span className="font-medium">{option.label}</span>
                <p className="text-gray-500">{option.description}</p>
              </label>
            </div>
          ))}
        </div>

        <div className="mt-8">
          <button
            type="submit"
            className="w-full md:w-auto px-6 py-2 bg-blue-600 text-white rounded-md hover:bg-blue-700 focus:outline-none focus:ring-2 focus:ring-blue-500 focus:ring-offset-2"
          >
            Submit
          </button>
        </div>
      </div>
    </form>
  );
};

export default CommunityIntakeForm;
